        <header className="header">
            <img src="http://placekitten.com/100/100?image=1" className="header__logo" alt="logo" />
            <h1 className="header__title">Header Title</h1>
            <div className="header__nav">
                <GlobalNav selectPage={selectPage}></GlobalNav>
            </div>
            {/* <GlobalNav className={"header__nav"} selectPage={selectPage}></GlobalNav> */}
        </header>
    )
}
export default Header
